INSERT INTO `ai_query_logs` VALUES ('37', '1', 'sql-mssql', 'get the information of salesperson peter', 'To get the information of salesperson Peter, we can extract the relevant data from the provided data capsule.\n\nThe columns available for this staff member (Peter) are:\n\n- **Id**: numeric identifier, samples include \"6\" and \"5\".\n- **StaffCode**: a code representing the salesperson, examples are \"E001\", \"YEOH\", etc.\n- **Name**: the name of the salesperson, exemplars include \"YAP CHAI LING\" and \"CINDY\".\n- **IDNo**: a unique identifier with code format, such as \"710808-14-3369\".\n\nFor the specific detail of Peter\'s, you would need to refer to the row in the data set where the StaffCode is \'PETER\'.', 'SELECT TOP 100 [Id], [StaffCode], [Name], [IDNo], [DateJoined], [DateLeft], [MobileNo], [Email], [Salary], [SOCSO], [EPF], [TaxFile] FROM [SalesPersons] ORDER BY [CommissionByDate] DESC;', '[{\"Id\":6,\"StaffCode\":\"E001\",\"Name\":\"YAP CHAI LING\",\"IDNo\":null,\"DateJoined\":null,\"DateLeft\":null,\"MobileNo\":null,\"Email\":null,\"Salary\":0,\"SOCSO\":null,\"EPF\":null,\"TaxFile\":null},{\"Id\":5,\"StaffCode\":\"YEOH\",\"Name\":\"YEOH\",\"IDNo\":\"710808-14-3369\",\"DateJoined\":\"2011-12-14T00:00:00.000Z\",\"DateLeft\":null,\"MobileNo\":null,\"Email\":null,\"Salary\":null,\"SOCSO\":null,\"EPF\":null,\"TaxFile\":null},{\"Id\":4,\"StaffCode\":\"SAM\",\"Name\":\"SAM LEE CHIN HONG\",\"IDNo\":\"A2869898\",\"DateJoined\":\"2011-12-14T00:00:00.000Z\",\"DateLeft\":null,\"MobileNo\":\"012-5001829\",\"Email\":\"samlee@advance.com.my\",\"Salary\":3000,\"SOCSO\":\"3541321\",\"EPF\":\"5456313\",\"TaxFile\":null},{\"Id\":3,\"StaffCode\":\"PETER\",\"Name\":\"PETER\",\"IDNo\":\"A3321185\",\"DateJoined\":\"2011-12-14T00:00:00.000Z\",\"DateLeft\":null,\"MobileNo\":\"017-8833288\",\"Email\":null,\"Salary\":null,\"SOCSO\":null,\"EPF\":null,\"TaxFile\":null},{\"Id\":2,\"StaffCode\":\"CINDY\",\"Name\":\"CINDY\",\"IDNo\":\"760225015044\",\"DateJoined\":\"2011-12-