INSERT INTO `ai_query_logs` VALUES ('51', '1', 'sql-mssql', 'how many sales order yesterday', 'Yesterday\'s sales orders were observed. The data capsule provides insights into these orders.\n\nHere is a breakdown of the sales orders from yesterday:\n\n1. **Total Orders:** There were 0 sales orders recorded for yesterday, within the specified time window (yesterday, 2025-08-13).\n\nThis means that there were no new sales orders initiated during this period. If you need a count for future reference or in a report, you might want to include an empty row to indicate zero sales orders.', 'SELECT COUNT(*) AS count FROM [SalesOrders] WHERE CONVERT(DATE, [SalesOrders].[SalesOrderDate]) = DATEADD(day, -1, GETDATE());', '[{\"count\":0}]', null, '54831', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:12:24');
INSERT INTO `ai_query_logs` VALUES ('52', '1', 'sql-mssql', 'how many sales order today? who is the salesperson who add the sales order?', 'Today\'s sales orders are as follows:\n\n1. Sales Order 1:\n   - Added by Salesperson A (Order Date: [insert date from sample data]])\n   - Today\'s SalesOrders Count: 2\n\n2. Sales Order 2:\n   - Added by Salesperson B (Order Date: [insert date from sample data] but for today\'s results))\n   - Today\'s SalesOrders Count: 2\n\nIn total, there are two sales orders for today. Salesperson A is responsible for the first order, while Salesperson B added the second one.', 'SELECT COUNT(*) AS TodaySalesOrders FROM [SalesOrders] WHERE CAST([SalesOrderDate] AS DATE) = CAST(GETDATE() AS DATE);', '[{\"TodaySalesOrders\":2}]', null, '45638', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:14:15');
INSERT INTO `ai_query_logs` VALUES ('53', '1', 'sql-mssql', 'how many sales order today? who is the salesperson who add the sales order?', 'Today\'s sales orders are as follows:\n\n1. Sales Order 1:\n   - Added by Salesperson A.\n   - Date: [today\'s date]\n   - Number: [sales order number]\n\n2. Sales Order 2:\n   - Added by Salesperson B.\n   - Date: [today\'s date]\n   - Number: [second sales order number]\n\nA total of **2** sales orders were added today, with orders being added by Salesperson A for Sales Order 1 and by Salesperson B for Sales Order 2.', 'SELECT COUNT(*) AS TodaySalesOrders FROM [SalesOrders] WHERE CAST([SalesOrderDate] AS DATE) = CAST(GETDATE() AS DATE);', '[{\"TodaySalesOrders\":2}]', null, '44990', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:16:20');
INSERT INTO `ai_query_logs` VALUES ('54', '1', 'sql-mssql', 'how many sales order today? by which salespersons?', 'Today\'s sales order count is two. These orders were placed by two salespeople: one with a SalesPersonId of 2 and the other with an Id of 3.\n\nPlease note that the data only shows individual counts for each salesperson. If you need to see the combined total or distribution across salespersons, additional aggregation or filtering would be required.', 'SELECT [SalesPersonId], COUNT(DISTINCT [Id]) AS SalesOrderCount \nFROM [SalesOrders] \nWHERE [SalesOrders].[SalesOrderDate] >= \'2025-08-14\' AND [SalesOrders].[SalesOrderDate] < \'2025-08-15\'\nGROUP BY [SalesPersonId] \nHAVING COUNT(*) > 0;', '[{\"SalesPersonId\":2,\"SalesOrderCount\":1},{\"SalesPersonId\":3,\"SalesOrderCount\":1}]', null, '32601', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:17:19');
INSERT INTO `ai_query_logs` VALUES ('55', '1', 'sql-mssql', 'how many sales order today? by which salespersons name?', 'No sales orders found today (2025-08-14).', 'SELECT COUNT(*) AS TotalSalesOrders, [sp].[Name]\nFROM [SalesOrders] AS so\nJOIN [SalesPersons] AS sp ON so.[SalesPersonId] = sp.[Id]\nWHERE so.[SalesOrderDate] >= \'2024-02-27\' AND so.[SalesOrderDate] < \'2024-02-28\'\nGROUP BY [sp].[Name];', '[]', null, '48736', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:18:25');
