INSERT INTO `ai_query_logs` VALUES ('60', '1', 'sql-mssql', 'how many sales order today? by which salesperson?', 'Today\'s sales order count is two. The orders were placed by Cindy and Peter, the respective salespeople.', 'SELECT \n    COUNT_BIG(*) AS NumberOfOrders,\n    [SalesPersons].[Name] AS SalesPersonName\nFROM \n    [SalesOrders]\nLEFT JOIN \n    [SalesPersons] ON [SalesOrders].[SalesPersonId] = [SalesPersons].[Id]\nWHERE \n    [SalesOrders].[SalesOrderDate] >= \'2025-08-14\' \n    AND [SalesOrders].[SalesOrderDate] < \'2025-08-15\'\nGROUP BY \n    [SalesPersons].[Name];', '[{\"NumberOfOrders\":\"1\",\"SalesPersonName\":\"CINDY\"},{\"NumberOfOrders\":\"1\",\"SalesPersonName\":\"PETER\"}]', null, '41444', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:41:07');
