INSERT INTO `ai_query_logs` VALUES ('65', '1', 'sql-mssql', 'how many sales order today? by which salesperson?', 'Today, you have seen two sales orders. The first order was placed by Cindy, as shown in the data:\n\n- `SalesPersonName`: \"CINDY\"\n- `NumberOfOrders`: 1\n\nThe second order was made by Peter, again included in the results:\n\n- `SalesPersonName`: \"PETER\"\n- `NumberOfOrders`: 1\n\nSo, today, there were two sales orders, both handled by Cindy and Peter respectively.', 'SELECT COUNT(*) AS NumberOfOrders, [SalesPersons].[Name] AS SalesPersonName FROM [SalesOrders] JOIN [SalesPersons] ON [SalesOrders].[SalesPersonId] = [SalesPersons].[Id] WHERE [SalesOrders].[SalesOrderDate] >= \'2025-08-14\' AND [SalesOrders].[SalesOrderDate] < \'2025-08-15\' GROUP BY [SalesPersons].[Name];', '[{\"NumberOfOrders\":1,\"SalesPersonName\":\"CINDY\"},{\"NumberOfOrders\":1,\"SalesPersonName\":\"PETER\"}]', null, '39612', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 14:57:19');
