INSERT INTO `ai_query_logs` VALUES ('91', '1', 'sql-mssql', 'which sales order has the highest price', 'The SQL result set for the label \"sales orders\" shows data from a time window not specified. There are 9 sales orders in total, with unique order codes like \"SO 00006\".\n\nThe highest priced sale is订单号为\"SO 00006\"的销售，其总价为1,460,500 units of price (looks like \"14***50\")).\n\nIn summary, the SQL result set indicates that there was a sales order with the highest price of $1,460,500.', 'SELECT TOP 1 so.SalesOrderCode, so.SalesOrderDate, so.DebtorName, CAST(SUM(sod.UnitPrice * sod.Qty) AS DECIMAL(18,2)) AS TotalPrice FROM [SalesOrders] so JOIN [SalesOrderDetails] sod ON so.Id = sod.SalesOrderId GROUP BY so.Id, so.SalesOrderCode, so.SalesOrderDate, so.DebtorName ORDER BY TotalPrice DESC;', '[{\"SalesOrderCode\":\"SO 00006\",\"SalesOrderDate\":\"2011-01-01T00:00:00.000Z\",\"DebtorName\":\"ADVANCE TRADING SDN. BHD.\",\"TotalPrice\":146050}]', null, '58631', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 15:44:43');
