INSERT INTO `ai_query_logs` VALUES ('124', '1', 'sql-mssql', 'how many sales order today', 'Today\'s sales orders summary is as follows:\n\nThere were a total of 2 sales orders recorded within the time window set to today, which is August 14, 2025. Each order had a count of 2.', 'SELECT COUNT(*) AS count FROM [SalesOrders] WHERE [SalesOrders].[SalesOrderDate] >= \'2025-08-14\' AND [SalesOrders].[SalesOrderDate] < \'2025-08-15\';', '[{\"count\":2}]', null, '42775', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 16:20:02');
INSERT INTO `ai_query_logs` VALUES ('125', '1', 'sql-mssql', 'how many sales order today? by which salesperson?', 'Today\'s sales orders, as of August 14, 2025, amount to two. They were placed by Cindy and Peter.\n\nFor Cindy\'s sales order, there is a single count (1). This indicates that Cindy had one sale today.\n\nPeter also had a single sale today, contributing another count of 1 to the total.\n\nIn summary, today saw two sales orders - one each from Cindy and Peter.', 'SELECT [sp].[Name], COUNT([so].[Id]) AS OrderCount FROM [SalesOrders] AS [so] JOIN [SalesPersons] AS [sp] ON [so].[SalesPersonId] = [sp].[Id] WHERE [so].[SalesOrderDate] >= CAST(GETDATE() AS DATE) AND [so].[SalesOrderDate] < CAST(GETDATE() + 1 AS DATE) GROUP BY [sp].[Name];', '[{\"Name\":\"CINDY\",\"OrderCount\":1},{\"Name\":\"PETER\",\"OrderCount\":1}]', null, '38784', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-14 16:21:40');
