INSERT INTO `ai_query_logs` VALUES ('175', '1', 'sql-mssql', 'get salesperson cindy information', 'Cindy is a salesperson in the company, identified by her StaffCode \"CINDY\". She joined on December 14, 2011, as shown by her DateJoined.\n\nCindy\'s availability to leave or make changes, represented by DateLeft, is not provided in this data set.\n\nRegarding commissions or payments made based on dates, CommissionByDate is also empty for Cindy.\n\nAs per the Name field, Cindy\'s full name is \"CINDY\".\n\nIn terms of identification numbers, Cindy\'s IDNo is \"760225015044\".\n\nContact details like mobile number and email are provided: MobileNo is \"012-2003388\" and Email is \"cindy@gmail. com\".\n\nFinally, Cindy earns a salary of 2500. Data related to SOCSO (Social Security Contributions) and EPF (Employee Provident Fund) is not included in this set.', 'SELECT [StaffCode], [DateJoined], [DateLeft], [CommissionByDate], [Name], [FixedCommissionDescription], [IDNo], [MobileNo], [Email], [Salary], [SOCSO], [EPF] FROM [SalesPersons] WHERE [Name] = N\'Cindy\' ORDER BY [StaffCode], [DateJoined] OFFSET 0 ROWS FETCH NEXT 100 ROWS ONLY;', '[{\"StaffCode\":\"CINDY\",\"DateJoined\":\"2011-12-14T00:00:00.000Z\",\"DateLeft\":null,\"CommissionByDate\":null,\"Name\":\"CINDY\",\"FixedCommissionDescription\":null,\"IDNo\":\"760225015044\",\"MobileNo\":\"012-2003388\",\"Email\":\"cindy@gmail.com\",\"Salary\":2500,\"SOCSO\":null,\"EPF\":null}]', null, '70452', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-15 08:39:21');
