-211D070C8B35\",\"DebtorName\":\"CARE SOFTWARE SOLUTIONS\",\"Attention\":\"MR. SIM\",\"Phone\":\"03-6188 6188\",\"Fax\":\"03-6188 3023\",\"Address1\":\"123, JALAN SBC 1,\",\"Address2\":\"TAMAN GOMBAK,\",\"Address3\":\"SELANGOR.\",\"Address4\":\"\"}]', null, '28776', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-15 11:12:57');
