INSERT INTO `ai_query_logs` VALUES ('271', '1', 'sql-mssql', 'how many sales order today? tell me the sales order code, the salesperson name, debtor name and the price of the sales order', 'Today, there are a total of 48 sales orders. Here\'s a breakdown of each sale:\n\n1. SalesOrderCode: SO 00010\n- SalesPersonName: Cindy\n- DebtorName: CARE SOFTWARE SOLUTIONS\n- TotalPrice: $13,999\n\n2. SalesOrderCode: SO 00003\n- SalesPersonName: Peter\n- DebtorName: BEST TECH ENGINEERING SDN. BHD.\n- TotalPrice: $2,950\n\nPlease note that the order codes and total prices are specific to these examples.', 'SELECT COUNT(*) AS NumberOfSalesOrders, [SalesOrderCode], [SalesPersons].Name AS SalesPersonName, [DebtorName], SUM(UnitPrice * Qty) AS TotalPrice FROM [SalesOrders] LEFT JOIN [SalesOrderDetails] ON [SalesOrders].[Id] = [SalesOrderDetails].[SalesOrderId] LEFT JOIN [SalesPersons] ON [SalesOrders].[SalesPersonId] = [SalesPersons].[Id] WHERE CAST([SalesOrderDate] AS DATE) = CAST(GETDATE() AS DATE) GROUP BY [SalesOrderId], [SalesOrderCode], [DebtorName], [SalesPersons].Name;', '[{\"NumberOfSalesOrders\":3,\"SalesOrderCode\":\"SO 00003\",\"SalesPersonName\":\"PETER\",\"DebtorName\":\"BEST TECH ENGINEERING SDN. BHD.\",\"TotalPrice\":2950},{\"NumberOfSalesOrders\":48,\"SalesOrderCode\":\"SO 00010\",\"SalesPersonName\":\"CINDY\",\"DebtorName\":\"CARE SOFTWARE SOLUTIONS\",\"TotalPrice\":13999}]', null, '103377', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-15 11:47:52');
INSERT INTO `ai_query_logs` VALUES ('272', '1', 'sql-mssql', 'how many sales order today? tell me the sales order code, the salesperson name, debtor name and the price of the sales order', 'Today, there are a total of 48 sales orders. Here\'s a breakdown of each order:\n\n1. SalesOrderCode: SO 00010, DebtorName: CARE SOFTWARE SOLUTIONS, SalespersonCode: CINDY, SalespersonName: Cindy, TotalPrice: $13,999\n2. SalesOrderCode: SO 00003, DebtorName: BEST TECH ENGINEERING SDN. BHD., SalespersonCode: PETER, SalespersonName: Peter, TotalPrice: $29,500\n\nSo, you can see the sales order details you requested for today\'s sales orders.', 'SELECT COUNT(*) AS NumberOfSalesOrders, [SalesOrderCode], [DebtorName], [StaffCode] AS SalespersonCode, [Name] AS SalespersonName, SUM([UnitPrice] * [Qty]) AS TotalPrice FROM [SalesOrders] JOIN [SalesPersons] ON [SalesOrders].[SalesPersonId] = [SalesPersons].[Id] JOIN [SalesOrderDetails] ON [SalesOrders].[Id] = [SalesOrderDetails].[SalesOrderId] WHERE [SalesOrders].[SalesOrderDate] >= \'2025-08-15\' AND [SalesOrders].[SalesOrderDate] < \'2025-08-16\' GROUP BY [SalesOrderCode], [DebtorName], [StaffCode], [Name];', '[{\"NumberOfSalesOrders\":3,\"SalesOrderCode\":\"SO 00003\",\"DebtorName\":\"BEST TECH ENGINEERING SDN. BHD.\",\"SalespersonCode\":\"PETER\",\"SalespersonName\":\"PETER\",\"TotalPrice\":2950},{\"NumberOfSalesOrders\":48,\"SalesOrderCode\":\"SO 00010\",\"DebtorName\":\"CARE SOFTWARE SOLUTIONS\",\"SalespersonCode\":\"CINDY\",\"SalespersonName\":\"CINDY\",\"TotalPrice\":13999}]', null, '128545', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-15 11:51:17');
INSERT INTO `ai_query_logs` VALUES ('273', '1', 'sql-mssql', 'how many sales order today? tell me the sales order code, the salesperson name, debtor name and the price of the sales order', 'Today, there are a total of 48 sales orders. Here\'s a breakdown of each order:\n\n1. SalesOrderCode: SO 00010, DebtorName: CARE SOFTWARE SOLUTIONS, SalespersonCode: CINDY, SalespersonName: Cindy, TotalPrice: $13,999\n2. SalesOrderCode: SO 00003, DebtorName: BEST TECH ENGINEERING SDN. BHD., SalespersonCode: PETER, SalespersonName: Peter, TotalPrice: $29,500\n\nSo, you can see the sales order details you requested for today\'s sales orders.', 'SELECT COUNT(*) AS NumberOfSalesOrders, [SalesOrderCode], [DebtorName], [StaffCode] AS SalespersonCode, [Name] AS SalespersonName, SUM([UnitPrice] * [Qty]) AS TotalPrice FROM [SalesOrders] JOIN [SalesPersons] ON [SalesOrders].[SalesPersonId] = [SalesPersons].[Id] JOIN [SalesOrderDetails] ON [SalesOrders].[Id] = [SalesOrderDetails].[SalesOrderId] WHERE [SalesOrders].[SalesOrderDate] >= \'2025-08-15\' AND [SalesOrders].[SalesOrderDate] < \'2025-08-16\' GROUP BY [SalesOrderCode], [DebtorName], [StaffCode], [Name];', '[{\"NumberOfSalesOrders\":3,\"SalesOrderCode\":\"SO 00003\",\"DebtorName\":\"BEST TECH ENGINEERING SDN. BHD.\",\"SalespersonCode\":\"PETER\",\"SalespersonName\":\"PETER\",\"TotalPrice\":2950},{\"NumberOfSalesOrders\":48,\"SalesOrderCode\":\"SO 00010\",\"DebtorName\":\"CARE SOFTWARE SOLUTIONS\",\"SalespersonCode\":\"CINDY\",\"SalespersonName\":\"CINDY\",\"TotalPrice\":13999}]', null, '126890', '::1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/139.0.0.0 Safari/537.36', '2025-08-15 11:55:09');
